import { PaymentElement, useElements, useStripe } from '@stripe/react-stripe-js'

import React, { useCallback, useState } from 'react'

export default function CheckOutForm() {

const [name, setName] = useState('')
const [lname, setLname] = useState('')
const stripe = useStripe()
const elements = useElements()


const handleSubmit = useCallback(async(ev) => {
ev.preventDefault()
const result = await stripe.confirmPayment({
  elements,
  confirmParams: {
    return_url:  window.location.origin + "/complete",
  },
});
console.log(result)
}, [name, lname])

  return (
    <div className='payment'>
<form onSubmit={(ev) => handleSubmit(ev)}>
<PaymentElement/>
<input value={name} onChange={(ev) => setName(ev.target.value)} type = 'text' placeholder='Your Name' />
<input value={lname} onChange={(ev) => setLname(ev.target.value)} type = 'text' placeholder='Your Lastname' />
<button type = 'submit' disabled={!stripe || !elements}>Pay</button>
</form>


    </div>
  )
}
